export const Form = ({userInput}) => {

    const [person, setPerson] = useState([])
    const [addPerson, setAddPerson] = useState(['CX'])

    useEffect(() => {
        fetch('/').then(response => {
            if(response.ok){
                return response.json()
            }
        }).then(data => setPerson(data))
    }, [])

    return (
        <>
            <form>
                <label>
                    Name:
                    <input type="text" required value={userInput}/>
                </label>
                <input type="submit"/>
            </form>
        </>
    )

}
